'------------------------------------------------------- ',
'-- Get User Property ',
'------------------------------------------------------- ',
'  ',
'function get_property( ',
'    p_user_name varchar2, ',
'    p_prop_name varchar2) ',
'return varchar2 ',
'is ',
'v_prop pmap_user_properties.property_value%type; ',
'begin ',
'  select property_value into v_prop from pmap_user_properties  ',
'  where user_name = p_user_name and property_name = p_prop_name; ',
'  return v_prop; ',
'exception ',
'  when no_data_found then ',
'  return null; ',
'end get_property; ',
'  ',
