'    p_node_id        number) ',
'is ',
'  v_node_order pmap_hierarchy.node_order%type; ',
'begin ',
'  if p_parent_node_id is not null then ',
'    begin ',
'      select max(nvl(node_order, 0))+1 into v_node_order from pmap_hierarchy ',
'      where parent_node_id = p_parent_node_id group by parent_node_id; ',
'      exception ',
'        when no_data_found then ',
'           v_node_order := 1; ',
'    end; ',
'    insert into pmap_hierarchy(parent_node_id, node_id, node_order) ',
'      values(p_parent_node_id, p_node_id, v_node_order); ',
'  end if; ',
'end node_new; ',
'  ',
'procedure delete_node( ',
'    p_parent_node_id number, ',
'    p_node_id        number) ',
'is ',
'  v_node_order number; ',
'  v_reorder    number; ',
'begin ',
'   watch_node(p_node_id, 1); ',
'   select node_order into v_node_order from pmap_hierarchy ',
'   where  parent_node_id = p_parent_node_id and node_id = p_node_id; ',
'   delete from pmap_hierarchy where parent_node_id = p_parent_node_id and node_id = p_node_id; ',
'   begin ',
'     select max(node_order) into v_reorder from pmap_hierarchy ',
'     where parent_node_id = p_parent_node_id and node_order < v_node_order group by parent_node_id; ',
'   exception ',
'     when no_data_found then ',
'       v_reorder := 0; ',
'   end; ',
'   for r_order in ( ',
'     select node_id from pmap_hierarchy ',
'     where parent_node_id = p_parent_node_id and node_order > v_node_order ',
'     order by node_order ',
'   ) loop ',
'     v_reorder := v_reorder + 1; ',
'     update pmap_hierarchy set node_order = v_reorder ',
'     where parent_node_id = p_parent_node_id and node_id = r_order.node_id; ',
'   end loop; ',
'end delete_node; ',
'  ',
'procedure move_node( ',
'    p_node_id            number, ',
'    p_old_parent_node_id number, ',
'    p_new_parent_node_id number) ',
'is ',
'begin ',
'    delete_node(p_old_parent_node_id, p_node_id); ',
'    node_new(p_new_parent_node_id, p_node_id); ',
'end move_node; ',
'  ',
'procedure node_up( ',
'    p_node_id number) ',
'is ',
'  v_parent_node_id   number; ',
'  v_node_id          number; ',
'  v_node_order_p     number; ',
'  v_node_order_c     number; ',
'begin ',
'  select node_order, parent_node_id into v_node_order_c, v_parent_node_id from pmap_hierarchy where node_id = p_node_id; ',
'  select node_id, node_order into v_node_id, v_node_order_p from ',
'    (select node_id, node_order from pmap_hierarchy  ',
'     where parent_node_id = v_parent_node_id and node_order < v_node_order_c order by node_order desc) ',
'  where rownum = 1; ',
'  update pmap_hierarchy set node_order = v_node_order_p where node_id = p_node_id and parent_node_id = v_parent_node_id; ',
'  update pmap_hierarchy set node_order = v_node_order_c where node_id = v_node_id and parent_node_id = v_parent_node_id; ',
'exception ',
'  when no_data_found then ',
'    null; ',
'end node_up; ',
'  ',
'procedure node_down( ',
'    p_node_id number) ',
'is ',
'  v_parent_node_id   number; ',
'  v_node_id          number; ',
'  v_node_order_p     number; ',
'  v_node_order_c     number; ',
'begin ',
'  select node_order, parent_node_id into v_node_order_c, v_parent_node_id from pmap_hierarchy where node_id = p_node_id; ',
'  select node_id, node_order into v_node_id, v_node_order_p from ',
'    (select node_id, node_order from pmap_hierarchy  ',
'     where parent_node_id = v_parent_node_id and node_order > v_node_order_c order by node_order asc) ',
'  where rownum = 1; ',
'  update pmap_hierarchy set node_order = v_node_order_p where node_id = p_node_id and parent_node_id = v_parent_node_id; ',
'  update pmap_hierarchy set node_order = v_node_order_c where node_id = v_node_id and parent_node_id = v_parent_node_id; ',
'exception ',
'  when no_data_found then ',
'    null; ',
'end node_down; ',
'  ',
'procedure node_top( ',
'    p_node_id number) ',
'is ',
'  v_parent_node_id number; ',
'  v_node_id        number; ',
'  v_reorder        number; ',
'begin ',
'  select parent_node_id into v_parent_node_id from pmap_hierarchy where node_id = p_node_id; ',
'  v_reorder := 2; ',
'  for v_rec in ( ',
'    select node_id from pmap_hierarchy where parent_node_id = v_parent_node_id order by node_order ',
'  ) loop ',
'    update pmap_hierarchy set node_order = v_reorder where parent_node_id = v_parent_node_id and node_id = v_rec.node_id; ',
'    v_reorder := v_reorder + 1; ',
'  end loop; ',
'  update pmap_hierarchy set node_order = 1 where node_id = p_node_id and parent_node_id = v_parent_node_id; ',
'exception ',
'  when no_data_found then ',
'    null; ',
'end node_top; ',
'  ',
'procedure node_bottom( ',
'    p_node_id number) ',
'is ',
'  v_parent_node_id number; ',
'  v_node_id        number; ',
'  v_reorder        number; ',
'begin ',
'  select parent_node_id into v_parent_node_id from pmap_hierarchy where node_id = p_node_id; ',
'  v_reorder := 1; ',
'  for v_rec in ( ',
'    select node_id from pmap_hierarchy where parent_node_id = v_parent_node_id order by node_order ',
'  ) loop ',
'    update pmap_hierarchy set node_order = v_reorder where parent_node_id = v_parent_node_id and node_id = v_rec.node_id; ',
'    v_reorder := v_reorder + 1; ',
'  end loop; ',
'  update pmap_hierarchy set node_order = v_reorder where node_id = p_node_id and parent_node_id = v_parent_node_id; ',
'exception ',
'  when no_data_found then ',
'    null; ',
'end node_bottom; ',
'  ',
'function check_node_up( ',
