'  select node_id, node_order into v_node_id, v_node_order_p from ',
'    (select node_id, node_order from pmap_hierarchy  ',
'     where parent_node_id = v_parent_node_id and node_order < v_node_order_c order by node_order desc) ',
'  where rownum = 1; ',
'  return true; ',
'exception ',
'  when no_data_found then ',
'    return false; ',
'end check_node_up; ',
'  ',
'function check_node_down( ',
