'function watch_mode_to_text( ',
'    p_watch_mode number) ',
'  return varchar2 ',
'is ',
'  v_text varchar2(80); ',
'begin ',
'  case p_watch_mode ',
unistr('  when 1 then v_text := ''\524A\9664''; '),
unistr('  when 2 then v_text := ''\66F4\65B0''; '),
unistr('  when 3 then v_text := ''\66F4\65B0&\524A\9664''; '),
unistr('  when 4 then v_text := ''\8FFD\52A0''; '),
unistr('  when 5 then v_text := ''\8FFD\52A0&\524A\9664''; '),
unistr('  when 6 then v_text := ''\8FFD\52A0&\66F4\65B0''; '),
unistr('  when 7 then v_text := ''\8FFD\52A0&\66F4\65B0&\524A\9664''; '),
'  end case; ',
'  return v_text; ',
'end watch_mode_to_text; ',
