'  ',
'function prelink(p_page number) ',
'    return varchar2 ',
'is ',
'  v_target varchar2(200); ',
'begin ',
'  v_target := ''f?p='' || V(''APP_ID'') || '':'' || p_page || '':'' || V(''SESSION'') || '':'' || v(''APP_PAGE_ID'') || '':NO:RP,'' || p_page || '':''; ',
'  return v_target; ',
'end prelink; ',
'  ',
