'end render_button; ',
'  ',
'function render_button_cs(p_url varchar2, p_label varchar2) ',
'    return varchar2 ',
'is ',
'begin ',
'  return ''<button onclick="'' || apex_util.prepare_url(p_url, ''UTF-8'', ''SESSION'') || ''" class="t-Button  " type="button"><span class="t-Button-label">'' || p_label || ''</span></button>''; ',
'end render_button_cs; ',
'  ',
'function update_link(p_node_id number) ',
'    return varchar2 ',
'is ',
'  v_page   varchar2(8); ',
'  v_target varchar2(200); ',
'begin ',
'  select t.update_page_target into v_page from pmap_types t, pmap_nodes n ',
'  where t.type_id = n.type_id and n.node_id = p_node_id; ',
'  if (v_page is null) then ',
'    return null; ',
'  end if; ',
'  v_target := prelink(v_page) || ''P'' || v_page || ''_NODE_ID:'' || p_node_id; ',
'  -- v_target := apex_page.get_url(p_page => v_page, p_items => ''P'' || v_page || ''_NODE_ID'', p_values => p_node_id); ',
'  return v_target; ',
'exception ',
'  when no_data_found then ',
'    return null; ',
'end update_link; ',
'  ',
'function render_link(p_node_id number) ',
'    return varchar2 ',
'is ',
'  v_page          varchar2(8); ',
'  v_type_id       pmap_types.type_id%type; ',
'  v_target        varchar2(200); ',
'  v_pointer_name  pmap_master_pointers.pointer_name%type; ',
'  v_pointer_link  pmap_master_pointers.pointer_link%type; ',
'  v_pointer_data  pmap_pointers.pointer_data%type; ',
'begin ',
'  select t.render_page_target, t.type_id into v_page, v_type_id ',
'  from pmap_types t, pmap_nodes n ',
'  where t.type_id = n.type_id and n.node_id = p_node_id; ',
'  if (v_page is null) then ',
'    case v_type_id ',
'    when ''PO'' then ',
'      select m.pointer_name, m.pointer_link, p.pointer_data ',
'      into v_pointer_name, v_pointer_link, v_pointer_data ',
'      from pmap_master_pointers m, pmap_pointers p ',
'      where m.pointer_name = p.pointer_name and p.node_id = p_node_id; ',
unistr('      if (v_pointer_name = ''\30CE\30FC\30C9'') then '),
'        v_target := direct_link_uri(to_number(v_pointer_data)); ',
'      else ',
'        v_target := v_pointer_link || v_pointer_data; ',
'      end if; ',
'      return v_target; ',
'    else ',
'      return direct_link_uri(p_node_id); ',
'    end case; ',
'  else ',
'    v_target := prelink(v_page) || ''P'' || v_page || ''_NODE_ID:'' || p_node_id; ',
'    -- v_target := apex_page.get_url(p_page => v_page, p_items => ''P'' || v_page || ''_NODE_ID'', p_values => p_node_id); ',
'    return v_target; ',
'  end if; ',
'exception ',
'  when no_data_found then ',
'    return null; ',
'end render_link; ',
'  ',
'function create_link(p_node_id number, p_type_id varchar2) ',
'    return varchar2 ',
'is ',
'  v_page   varchar2(8); ',
'  v_target varchar2(200); ',
'begin ',
'  select create_page_target into v_page from pmap_types ',
'  where type_id = p_type_id; ',
'  if (v_page is null) then ',
'    return null; ',
'  end if; ',
'  v_target := prelink(v_page) || ''P'' || v_page || ''_PARENT_NODE_ID,P'' || v_page || ''_TYPE_ID:'' || p_node_id || '','' || p_type_id; ',
'  -- v_target := apex_page.get_url(p_page => v_page,  ',
'  -- p_items => ''P'' || v_page || ''_PARENT_NODE_ID,P'' || v_page || ''_TYPE_ID'', ',
'  -- p_values => p_node_id || '','' || p_type_id); ',
'  return v_target; ',
'exception ',
'  when no_data_found then ',
'    return null; ',
'end create_link; ',
'  ',
'function delete_link(p_node_id number, p_parent_node_id number) ',
'    return varchar2 ',
'is ',
'  v_page   varchar2(8); ',
'  v_target varchar2(200); ',
'begin ',
