'  where t.type_id = n.type_id and n.node_id = p_node_id; ',
'  if (v_page is null) then ',
'    return null; ',
'  end if; ',
'  v_target := prelink(v_page) || ''P'' || v_page || ''_NODE_ID,P'' || v_page || ''_PARENT_NODE_ID:'' || p_node_id || '','' || p_parent_node_id; ',
'  -- v_target := apex_page.get_url(p_page => v_page,  ',
'  -- p_items => ''P'' || v_page || ''_NODE_ID,P'' || v_page || ''_PARENT_NODE_ID'', ',
'  -- p_values => p_node_id || '','' || p_parent_node_id); ',
'  return v_target; ',
'exception ',
