'  ',
'function move_link(p_node_id number, p_parent_node_id number) ',
'    return varchar2 ',
'is ',
'  v_page   varchar2(8); ',
'  v_target varchar2(200); ',
'begin ',
'  select t.move_page_target into v_page from pmap_types t, pmap_nodes n ',
'  where t.type_id = n.type_id and n.node_id = p_node_id; ',
'  if (v_page is null) then ',
'    return null; ',
'  end if; ',
'  v_target := prelink(v_page) || ''P'' || v_page || ''_NODE_ID,P'' || v_page || ''_OLD_PARENT_NODE_ID:'' || p_node_id || '','' || p_parent_node_id; ',
'  -- v_target := apex_page.get_url(p_page => v_page,  ',
'  -- p_items => ''P'' || v_page || ''_NODE_ID,P'' || v_page || ''_OLD_PARENT_NODE_ID'', ',
'  -- p_values => p_node_id || '','' || p_parent_node_id); ',
'  return v_target; ',
'exception ',
'  when no_data_found then ',
'    return null; ',
'end move_link; ',
'  ',
'------------------------------------------------------- ',
'-- Render Node - Root rendering procedure. ',
'------------------------------------------------------- ',
'  ',
'procedure render_node( ',
'    p_level          number, ',
'    p_node_id        number, ',
'    p_parent_node_id number) ',
'is ',
'  v_level  number; ',
'  v_indent number; ',
'  v_render_proc pmap_types.render_procedure%type; ',
'  v_sql_stmt varchar2(200); ',
'   ',
'  cursor c_node is ',
'    select node_id from pmap_hierarchy_pv ',
'    where parent_node_id = p_node_id ',
'    and type_id in  ',
'    (select s.sibling_type_id  ',
'     from pmap_type_siblings s, pmap_nodes n ',
'     where n.node_id = p_node_id and n.type_id = s.type_id) ',
'    order by node_order asc; ',
'  node_rec c_node%rowtype; ',
'begin ',
'  -- get the actual render procedure for the specific type of node. ',
'  begin ',
'    select t.render_procedure into v_render_proc ',
'    from pmap_nodes n, pmap_types t ',
'    where n.type_id = t.type_id and n.node_id = p_node_id; ',
'  exception ',
'      when no_data_found then ',
'      v_render_proc := null; ',
'  end; ',
'  -- PMAP_UTIL.RENDER_GENERIC_NODE is the hardcorded default renderer. ',
'  if (v_render_proc = '''' or v_render_proc is null) then ',
'    v_render_proc := ''PMAP_UTIL.RENDER_GENERIC_NODE''; ',
'  end if; ',
'  -- render node specific data. ',
'  v_sql_stmt := ''CALL '' || v_render_proc || ''(:1, :2, :3)''; ',
'  -- calculate indent, no indent for the first level child. ',
'  v_indent := p_level - 1; ',
'  if (v_indent < 0) then ',
'     v_indent := 0; ',
'  end if; ',
'   ',
'  --  ',
'  v_indent := v_indent * 2; ',
'  htp.p(''<div id="POS_NODE_ID_'' || p_node_id || ''" style="padding-left:'' || v_indent || ''em">''); ',
'  execute immediate v_sql_stmt using p_level, p_node_id, p_parent_node_id; ',
'  htp.p(''</div>''); ',
'   ',
'  -- render child nodes of this node. ',
'  v_level := p_level + 1; ',
'  open c_node; ',
'  loop ',
'    fetch c_node into node_rec; ',
'    exit when c_node%notfound; ',
'    v_sql_stmt := ''CALL PMAP_UTIL.RENDER_NODE(:1, :2, :3)''; ',
'    execute immediate v_sql_stmt using v_level, node_rec.node_id, p_node_id; ',
'  end loop; ',
'  close c_node; ',
'end render_node; ',
'  ',
'------------------------------------------------------- ',
'-- Render Generic Node Information for Debugging ',
'------------------------------------------------------- ',
'  ',
'procedure render_generic_node( ',
'    p_level          number, ',
'    p_node_id        number, ',
'    p_parent_node_id number) ',
'is ',
'  node_rec  pmap_nodes%rowtype; ',
'  v_note       clob; ',
'begin ',
'   select * into node_rec from pmap_nodes where node_id = p_node_id; ',
'   htp.p(''<hr/>''); ',
'   htp.p(''Level: ''          || p_level); ',
'   htp.p(''NODE_ID: ''        || node_rec.node_id); ',
'   htp.p(''PARENT_NODE_ID: '' || p_parent_node_id); ',
'   htp.p(''TYPE_ID: ''        || node_rec.type_id); ',
'   htp.p(''TITLE: ''          || node_rec.title); ',
'   htp.p(''Update Link: '' || update_link(p_node_id)); ',
'exception ',
'   when no_data_found then ',
'     null; ',
'end render_generic_node; ',
'  ',
'------------------------------------------------------- ',
'-- Render Generic Document Information for Debugging ',
'------------------------------------------------------- ',
'  ',
'procedure render_generic_document( ',
'    p_level          number, ',
'    p_node_id        number, ',
'    p_parent_node_id number) ',
'is ',
'  node_rec     pmap_nodes%rowtype; ',
'  v_note       clob; ',
'begin ',
'  htp.p(''<hr/>''); ',
'  -- Print PMAP_NODES info. ',
'  begin ',
'    select title into node_rec.title  ',
'    from pmap_nodes where node_id = p_node_id; ',
'  exception ',
'    when no_data_found then ',
'      node_rec.title := null; ',
'  end; ',
unistr('  htp.p(''\4EF6\540D: '' || node_rec.title); '),
'  ',
'  -- Print PMAP_DOCUMENTS info. ',
'  begin ',
'    select note into v_note from pmap_documents where node_id = p_node_id; ',
'    print_clob(v_note); ',
'  exception ',
'    when no_data_found then ',
'      null; ',
'  end; ',
'end render_generic_document; ',
'  ',
'------------------------------------------------------- ',
'-- Project ',
'------------------------------------------------------- ',
'  ',
'function project_title( ',
'    p_node_id number) ',
'return varchar2 ',
'is ',
'  node_rec        pmap_nodes%rowtype; ',
'  v_test_count    number; ',
'  v_title   varchar2(2000); ',
'begin ',
'  select title into node_rec.title  ',
'  from pmap_nodes where node_id = p_node_id; ',
'  select count(*) into v_test_count from pmap_hierarchy_pv ',
'  where parent_node_id = p_node_id and type_id in (''T'',''P''); ',
'  if ( v_test_count > 0 ) then ',
unistr('    v_title := ''\30D7\30ED\30B8\30A7\30AF\30C8:'' || node_rec.title || '' ('' || v_test_count || '')''; '),
'  else ',
unistr('    v_title := ''\30D7\30ED\30B8\30A7\30AF\30C8:'' || node_rec.title; '),
'  end if; ',
'  return v_title; ',
'exception ',
'  when no_data_found then ',
'    return ''=== bad data ===''; ',
'end project_title; ',
'  ',
'------------------------------------------------------- ',
'-- Rendering Test ',
'------------------------------------------------------- ',
'  ',
'procedure render_test( ',
'    p_level          number, ',
'    p_node_id        number, ',
'    p_parent_node_id number) ',
'is ',
'  node_rec      pmap_nodes%rowtype; ',
'  v_note        clob; ',
'  v_test_attribute varchar2(400); ',
'  v_test_tag    pmap_tests.test_tag%type; ',
'  v_assignee    pmap_tests.assignee%type; ',
'begin ',
'  begin ',
'    select l.test_status_name, t.test_tag, t.assignee into v_test_attribute, v_test_tag, v_assignee ',
'    from pmap_test_status_lov l, pmap_tests t ',
'    where l.test_status_id = t.test_status and t.node_id = p_node_id; ',
unistr('    v_test_attribute := ''\30C6\30B9\30C8\9032\6357: '' || v_test_attribute || '' \62C5\5F53\8005:'' || v_assignee || '' \30BF\30B0:'' || v_test_tag; '),
'  exception ',
'    when no_data_found then ',
'       null; ',
'  end; ',
'  border_region_start_open(p_node_id, v_test_attribute); ',
'    render_controls_priv(p_node_id, p_parent_node_id); ',
'  border_region_start_close; ',
'  begin ',
'    select note into v_note from pmap_documents where node_id = p_node_id; ',
'    print_clob(v_note); ',
'  exception ',
'    when no_data_found then ',
'      null; ',
'  end; ',
'  border_region_end_open; ',
'    render_footer_priv(''PMAP_TESTS'', p_node_id); ',
'  border_region_end_close; ',
'end render_test; ',
