'function test_title( ',
'   p_node_id number) ',
'   return varchar2 ',
'is ',
'  v_title pmap_nodes.title%type; ',
'  v_test_status_name pmap_test_status_lov.test_status_name%type; ',
'begin ',
'  select l.test_status_name, n.title ',
'  into v_test_status_name, v_title ',
'  from pmap_nodes n, pmap_tests t, pmap_test_status_lov l ',
'  where n.node_id = p_node_id ',
'    and n.node_id = t.node_id ',
'    and t.test_status = l.test_status_id; ',
unistr('  return ''\30C6\30B9\30C8:'' || v_test_status_name || '':'' || v_title; '),
'exception ',
'  when no_data_found then ',
'    -- won''t happen ',
'    return ''BUG - NODE_ID '' || p_node_id || '' has invalid values.''; ',
'end test_title; ',
