'-- Rendering Test ',
'------------------------------------------------------- ',
'  ',
'procedure render_summary( ',
'    p_level          number, ',
'    p_node_id        number, ',
'    p_parent_node_id number) ',
'is ',
'  node_rec      pmap_nodes%rowtype; ',
'  v_test_status pmap_test_status_lov.test_status_name%type; ',
'  v_link_url    varchar2(2000); ',
'  v_summary     pmap_summaries%rowtype; ',
'  v_tests       pmap_tests%rowtype; ',
'begin ',
'  select * into v_summary from pmap_summaries where node_id = p_node_id; ',
'  render_controls_priv(p_node_id, p_parent_node_id); ',
'  for v_rec in ( ',
'    select n.node_id, n.title, d.note ',
'    from pmap_hierarchy_pv p, pmap_documents d, pmap_nodes n ',
'    where p.parent_node_id = ',
'      (select parent_node_id from pmap_hierarchy_pv ',
'       where node_id = p_node_id) ',
'    and p.node_id = d.node_id and p.node_id = n.node_id ',
'    and n.type_id = v_summary.node_type order by p.node_order ',
'  ) loop ',
'    if (v_summary.node_type = ''T'') then ',
'      -- currently only pmap_tests is supported. ',
'      begin ',
'        select * into v_tests from pmap_tests where node_id = v_rec.node_id; ',
'        select test_status_name into v_test_status from pmap_test_status_lov where test_status_id = v_tests.test_status; ',
'      exception ',
'        when no_data_found then ',
'           null; ',
'      end; ',
'      if (v_summary.who_created is not null and not regexp_like(v_tests.created_by, v_summary.who_created)) then ',
'        continue; ',
'      end if; ',
'      if (v_summary.who_last_updated is not null and not regexp_like(v_tests.last_updated_by, v_summary.who_last_updated)) then ',
'        continue; ',
'      end if; ',
'      if (v_summary.test_status is not null and (v_tests.test_status is null or v_tests.test_status <> v_summary.test_status)) then ',
'        continue; ',
'      end if; ',
'      if (v_summary.assignee is not null and (v_tests.assignee is null or not regexp_like(v_tests.assignee, v_summary.assignee))) then ',
'        continue; ',
'      end if; ',
'      if (v_summary.tag is not null and (v_tests.test_tag is null or not regexp_like(v_tests.test_tag, v_summary.tag))) then ',
'        continue; ',
'      end if; ',
'      v_link_url := v_test_status || '':<a href="'' || direct_link_uri(v_rec.node_id) || ''" target="_blank">''  ',
'              || v_rec.title || ''</a>''; ',
'      collapse_region_start_open(v_rec.node_id, v_link_url); ',
'        -- render_controls_priv(v_rec.node_id, p_parent_node_id); ',
'      collapse_region_start_close; ',
'      begin ',
'        -- htp.p(''debug - '' || v_summary.tag || '' - '' || v_tests.test_tag); ',
'        print_clob(v_rec.note); ',
'      exception ',
'        when no_data_found then ',
'          null; ',
'      end; ',
'      collapse_region_end_open; ',
'        render_footer_priv(''PMAP_TESTS'', v_rec.node_id); ',
'      collapse_region_end_close; ',
'    else ',
'      -- other types are todo. ',
'      collapse_region_start_open(v_rec.node_id, v_rec.title); ',
'        -- render_controls_priv(v_rec.node_id, p_parent_node_id); ',
'      collapse_region_start_close; ',
'      begin ',
'        print_clob(v_rec.note); ',
'      exception ',
'        when no_data_found then ',
'          null; ',
'      end; ',
'      collapse_region_end_open; ',
'        render_footer_priv(''PMAP_DOCUMENTS'', v_rec.node_id); ',
'      collapse_region_end_close; ',
'    end if; ',
'  end loop; ',
'exception ',
'  when no_data_found then ',
'    -- no row in pmap_summaries, nothing should be done. ',
'    null; ',
'end render_summary; ',
'  ',
