'function pointer_title( ',
'    p_node_id number) ',
'return varchar2 ',
'is ',
'  node_rec        pmap_nodes%rowtype; ',
'  v_pointer_name  pmap_pointers.pointer_name%type; ',
'  v_pointer_link  pmap_master_pointers.pointer_link%type; ',
'  v_pointer_data  pmap_pointers.pointer_data%type; ',
'  v_title   varchar2(2000); ',
'begin ',
'  select title into node_rec.title  ',
'  from pmap_nodes where node_id = p_node_id; ',
'  select m.pointer_name, m.pointer_link, p.pointer_data  ',
'  into v_pointer_name, v_pointer_link, v_pointer_data ',
'  from pmap_master_pointers m, pmap_pointers p  ',
'  where m.pointer_name = p.pointer_name and p.node_id = p_node_id; ',
'  if (v_pointer_link is not null) then ',
'    v_title := v_pointer_name || '':'' || v_pointer_data || '' - '' || node_rec.title; ',
'  else ',
'    v_title := v_pointer_name || '' - '' || node_rec.title; ',
'  end if; ',
'  return v_title; ',
'exception ',
'  when no_data_found then ',
'    return ''=== bad data ===''; ',
'end pointer_title; ',
