'------------------------------------------------------- ',
'-- Render REST Request ',
'------------------------------------------------------- ',
'  ',
'procedure render_rest_request( ',
'    p_level          number, ',
'    p_node_id        number, ',
'    p_parent_node_id number) ',
'is ',
'  node_rec     pmap_nodes%rowtype; ',
'  v_rest_request pmap_rest_requests%rowtype; ',
'begin ',
'  begin ',
'    select title into node_rec.title  ',
'    from pmap_nodes where node_id = p_node_id; ',
'  exception ',
'    when no_data_found then ',
'      node_rec.title := null; ',
'  end; ',
'  collapse_region_start_open(p_node_id, node_rec.title); ',
'    render_controls_priv(p_node_id, p_parent_node_id); ',
'  collapse_region_start_close; ',
'  begin ',
'    select  ',
'      URL, ',
'      HTTP_METHOD, ',
'      PROXY_OVERRIDE, ',
'      TRANSFER_TIMEOUT, ',
'      BODY, ',
'      PARM_NAME, ',
'      PARM_VALUE, ',
'      WALLET_PATH, ',
'      WALLET_PWD ',
'    into ',
'      v_rest_request.url, ',
'      v_rest_request.http_method, ',
'      v_rest_request.proxy_override, ',
'      v_rest_request.transfer_timeout, ',
'      v_rest_request.body, ',
'      v_rest_request.parm_name, ',
'      v_rest_request.parm_value, ',
'      v_rest_request.wallet_path, ',
'      v_rest_request.wallet_pwd ',
'    from ',
'      pmap_rest_requests ',
'    where node_id = p_node_id; ',
'    htp.p(''<code>''); ',
'    if (v_rest_request.url is not null) then ',
'      htp.p(''URL: '' || v_rest_request.url); ',
'    end if; ',
'    if (v_rest_request.http_method is not null) then ',
unistr('      htp.p(''HTTP\30E1\30BD\30C3\30C9: '' || v_rest_request.http_method); '),
'    end if; ',
'    if (v_rest_request.proxy_override is not null) then ',
'      htp.p(''Proxy Override: '' || v_rest_request.proxy_override); ',
'    end if; ',
'    if (v_rest_request.transfer_timeout is not null) then ',
'      htp.p(''Transfer Timeout: '' || v_rest_request.transfer_timeout); ',
'    end if; ',
'    if (v_rest_request.body is not null) then ',
'      htp.p(''Body: '' || CHR(10) || v_rest_request.body); ',
'    end if; ',
'    if (v_rest_request.parm_name is not null) then ',
unistr('      htp.p(''\30D1\30E9\30E1\30FC\30BF\540D: '' || v_rest_request.parm_name); '),
'    end if; ',
'    if (v_rest_request.parm_value is not null) then ',
unistr('      htp.p(''\30D1\30E9\30E1\30FC\30BF\5024: '' || v_rest_request.parm_value); '),
'    end if; ',
'    if (v_rest_request.wallet_path is not null) then ',
unistr('      htp.p(''\30A6\30A9\30EC\30C3\30C8\30D1\30B9: '' || v_rest_request.wallet_path); '),
'    end if; ',
'    if (v_rest_request.wallet_pwd is not null) then ',
unistr('      htp.p(''\30A6\30A9\30EC\30C3\30C8\30D1\30B9\30EF\30FC\30C9: '' || v_rest_request.wallet_pwd); '),
'    end if; ',
'    htp.p(''</code>''); ',
'  exception ',
'    when no_data_found then ',
'      null; ',
'  end; ',
'  collapse_region_end_open; ',
'    render_footer_priv(''PMAP_REST_REQUESTS'', p_node_id); ',
'  collapse_region_end_close; ',
'end render_rest_request; ',
