'------------------------------------------------------- ',
'-- Render REST Response ',
'------------------------------------------------------- ',
'  ',
'procedure render_rest_response( ',
'    p_level          number, ',
'    p_node_id        number, ',
'    p_parent_node_id number) ',
'is ',
'  node_rec     pmap_nodes%rowtype; ',
'  v_note       clob; ',
'begin ',
'  begin ',
'    select title into node_rec.title  ',
'    from pmap_nodes where node_id = p_node_id; ',
'  exception ',
'    when no_data_found then ',
'      node_rec.title := null; ',
'  end; ',
'  collapse_region_start_open(p_node_id, node_rec.title); ',
'  render_controls_priv(p_node_id, p_parent_node_id); ',
'  collapse_region_start_close_id(p_node_id); ',
'  -- Print PMAP_DOCUMENTS info. ',
'  htp.p(''<script>''); ',
'  begin ',
'    select note into v_note from pmap_documents where node_id = p_node_id; ',
'  exception ',
'    when no_data_found then ',
'      v_note := null; ',
'  end; ',
'  if (v_note is not null) then ',
'    htp.p(''var re = document.getElementById("REGION_BODY_NODE_ID_'' || p_node_id || ''");''); ',
'    htp.p(''var ce = document.createElement("code");''); ',
'    htp.p(''var jss = ''); ',
'    print_clob(v_note); ',
'    htp.p('';''); ',
'    htp.p(''var jstr = JSON.stringify(jss,null,4);''); ',
'    htp.p(''var tx = document.createTextNode(jstr);''); ',
'    htp.p(''re.appendChild(ce).appendChild(tx);''); ',
'  end if; ',
'  htp.p(''</script>''); ',
'  -- render header values ',
'  for v_hs in (select header_name, header_value from pmap_rest_response_headers where node_id = p_node_id) ',
'  loop ',
'    htp.br; ',
'    htp.p(v_hs.header_name || '':'' || v_hs.header_value); ',
'  end loop; ',
'  collapse_region_end_open; ',
'  render_footer_priv(''PMAP_DOCUMENTS'', p_node_id); ',
'  collapse_region_end_close; ',
'end render_rest_response; ',
'  ',
