'------------------------------------------------------- ',
'-- Render Controls and Footer ',
'------------------------------------------------------- ',
'  ',
'function get_type_name_priv(p_type_id varchar2) ',
'    return varchar2 ',
'is ',
'  v_type_name pmap_types.type_name%type; ',
'begin ',
'  select type_name into v_type_name from pmap_types where type_id = p_type_id; ',
'  return v_type_name; ',
'end get_type_name_priv; ',
'    ',
'function control_exists_priv(p_node_id number, p_type_id varchar2) ',
'    return boolean ',
'is ',
'  v number; ',
'begin ',
'  select 1 into v from pmap_type_siblings s, pmap_nodes n ',
'  where n.type_id = s.type_id and n.node_id = p_node_id and s.sibling_type_id = p_type_id; ',
'  return true; ',
'exception ',
'  when no_data_found then ',
'  return false; ',
'end control_exists_priv; ',
'  ',
'procedure render_controls_priv( ',
'    p_node_id number, ',
'    p_parent_node_id number) ',
'is ',
'  v_node_type          pmap_types.type_id%type; ',
'  type v_types is varray(40) of varchar2(2); ',
'  v_url varchar2(400); ',
'begin ',
'  select t.type_id into v_node_type ',
'  from pmap_nodes n, pmap_types t where n.type_id = t.type_id and node_id = p_node_id; ',
'  if (v_node_type = ''AT'') then ',
unistr('    htp.p(render_button(update_link(p_node_id), ''\30C0\30A6\30F3\30ED\30FC\30C9'')); '),
'  else ',
'    v_url := update_link(p_node_id); ',
'    if (v_url is not null) then ',
unistr('      htp.p(render_button(v_url, ''\66F4\65B0'')); '),
'    end if; ',
'  end if; ',
'  render_controls_by_list(p_node_id); ',
'  v_url := move_link(p_node_id, p_parent_node_id); ',
'  if v_url is not null then ',
unistr('    htp.p(render_button(v_url, ''\79FB\52D5'')); '),
'  end if; ',
'  -- All node has delete link. ',
'  v_url := delete_link(p_node_id, p_parent_node_id); ',
'  if v_url is not null then ',
unistr('    htp.p(render_button(v_url, ''\524A\9664'')); '),
'  end if; ',
'end render_controls_priv; ',
'  ',
'procedure render_controls_by_list ',
'     (p_node_id number) ',
'is ',
'  v_c number; ',
'begin ',
'  begin ',
'    select count(*) into v_c from pmap_type_siblings s, pmap_nodes n ',
'  where n.type_id = s.type_id and n.node_id = p_node_id; ',
'  exception ',
'    when no_data_found then ',
'      null; ',
'  end; ',
'  if v_c = 0 then ',
'    return; ',
'  end if; ',
'  htp.p(''<select id="NODE_'' || p_node_id || ''" name="node_'' || p_node_id || ''" class="t-Form-select" size="1">'' ); ',
'  htp.p(''<option value="" selected="selected" ></option>''); ',
'  --  ',
'  for v_rec in ( ',
'    select type_id, enabler_name from pmap_menu_settings where link_flag = ''Y'' order by type_order ',
'  ) loop ',
'    if (control_exists_priv(p_node_id, v_rec.type_id)) then ',
'      if (v_rec.enabler_name is null or v(v_rec.enabler_name) = ''Y'') then ',
'        htp.p(''<option value="'' || create_link(p_node_id, v_rec.type_id) || ''">'' || get_type_name_priv(v_rec.type_id) || ''</option>''); ',
'      end if; ',
'    end if; ',
'  end loop; ',
'  htp.p(''</select>''); ',
unistr('  htp.p(''<button onclick="apex.navigation.redirect(document.getElementById(''''NODE_'' || p_node_id || '''''').value)" class="t-Button" type="button"><span class="t-Button-label">\8FFD\52A0</span></button>''); '),
'  if (control_exists_priv(p_node_id, ''AT'')) then ',
'    if (v(''ENABLE_ATTACHMENT'') = ''Y'') then ',
unistr('      htp.p(render_button_cs(create_link(p_node_id, ''AT''), get_type_name_priv(''AT'') || ''\8FFD\52A0'')); '),
'    end if; ',
'  end if; ',
'  -- render the button jumps to rest request page. ',
'  begin ',
'    select 1 into v_c from pmap_nodes where node_id = p_node_id and type_id = ''RR''; ',
'    -- ',
unistr('    htp.p(render_button_cs(prelink(69) || ''P69_NODE_ID:'' || p_node_id, ''REST\30EA\30AF\30A8\30B9\30C8\767A\884C'')); '),
'  exception ',
'    when no_data_found then ',
'      null; ',
'  end; ',
'end render_controls_by_list; ',
'  ',
'procedure render_footer_priv(p_table_name varchar2,  ',
'                        p_node_id number) ',
'is ',
'  v_sql varchar2(200); ',
'  -- any table should have created_by, creation_date and so on, ',
'  -- they all must be the same type as with pmap_nodes. ',
'  -- if it is not, such type must be updated. ',
'  v_created_by       pmap_nodes.created_by%type; ',
'  v_creation_date    pmap_nodes.creation_date%type; ',
'  v_last_updated_by  pmap_nodes.last_updated_by%type; ',
'  v_last_update_date pmap_nodes.last_update_date%type; ',
'begin ',
'  execute immediate ''select created_by, creation_date, last_updated_by, last_update_date from '' ',
'  || p_table_name || '' where node_id = :nbode_id'' ',
'  into v_created_by, v_creation_date, v_last_updated_by, v_last_update_date using p_node_id; ',
unistr('  htp.p(''<div style="font-size:60%;">\4F5C\6210\8005:'' || v_created_by ||  '),
unistr('        '' - \4F5C\6210\65E5\4ED8: '' ||  '),
'        to_char(v_creation_date at time zone ''09:00'', ''DD-MON-YYYY HH24:MI:SS TZH:TZM'') || ''</div>''); ',
unistr('  htp.p(''<div style="font-size:60%;">\6700\7D42\66F4\65B0\8005:'' || v_last_updated_by ||  '),
unistr('        '' - \6700\7D42\66F4\65B0\65E5\4ED8: '' ||  '),
'        to_char(v_last_update_date at time zone ''09:00'', ''DD-MON-YYYY HH24:MI:SS TZH:TZM'') || ''</div>''); ',
'end render_footer_priv; ',
'  ',
'------------------------------------------------------- ',
'-- Render Help ',
'------------------------------------------------------- ',
'  ',
'procedure render_help(p_page_id number) ',
'is ',
'   v_help_text clob; ',
'begin ',
'   select help_text into v_help_text from pmap_help ',
'   where page_id = p_page_id; ',
'   htp.p(v_help_text); ',
'exception ',
'   when no_data_found then ',
'      null; ',
'end render_help; ',
'  ',
'------------------------------------------------------- ',
'-- Watch ',
'------------------------------------------------------- ',
'  ',
'procedure watch_node( ',
'    p_node_id number, ',
'    p_watch_mode number) ',
'is ',
'  v_title pmap_nodes.title%type; ',
'  v_note  varchar2(4000); ',
'  v_doctype pmap_documents.document_type%type; ',
'  v_url   varchar2(200); ',
'  l_id  number; ',
'  csize number; ',
'begin ',
'  begin ',
'    select title into v_title from pmap_nodes where node_id = p_node_id; ',
'  exception ',
'    when no_data_found then ',
unistr('      v_title := ''\30CE\30FC\30C9\756A\53F7: '' || p_node_id; '),
'  end; ',
'  begin ',
'    select dbms_lob.substr(note, 2000, 1), document_type into v_note, v_doctype ',
'    from pmap_documents where node_id = p_node_id; ',
'  exception ',
'    when no_data_found then ',
unistr('         v_note := ''\672C\6587\306A\3057''; '),
'         v_doctype := ''PLAIN''; ',
'  end; ',
'  v_url := direct_link(p_node_id); ',
'  for v_rec in ',
'  ( ',
'    select w.user_name as user_name, w.headline as headline ',
'    from  ',
'    (select node_id, type_id from pmap_hierarchy_pv  ',
'     start with node_id = p_node_id connect by prior parent_node_id = node_id) p, ',
'     pmap_hierarchy_pv t, ',
'     pmap_watches w ',
'    where t.parent_node_id = p.node_id and w.node_id = t.node_id and t.type_id = ''W'' ',
'      and bitand(p_watch_mode, w.watch_mode) <> 0 ',
'  ) loop ',
'    -- do not send myself. ',
'    if ( upper(trim(v_rec.user_name)) <> v(''APP_USER'') ) then ',
'      if (v_doctype <> ''PLAIN'') then ',
'        l_id := apex_mail.send( ',
'            p_to        => v_rec.user_name, ',
'            p_from      => v(''APP_USER''), ',
'            p_subj      => v_rec.headline || watch_mode_to_text(p_watch_mode) || '': '' || v_title, ',
'            p_body      => v_note, ',
'            p_body_html => v_url || v_note); ',
'      else ',
'        l_id := apex_mail.send( ',
'            p_to        => v_rec.user_name, ',
'            p_from      => v(''APP_USER''), ',
'            p_subj      => v_rec.headline || watch_mode_to_text(p_watch_mode) || '': '' || v_title, ',
'            p_body      => v_note, ',
'            p_body_html => v_url || ''<code>'' || v_note || ''</code>''); ',
'      end if; ',
'      apex_mail.push_queue; ',
'    end if; ',
'  end loop; ',
'end watch_node; ',
'  ',
'------------------------------------------------------- ',
'-- Watch ',
'------------------------------------------------------- ',
'  ',
'procedure delete_watches(p_node_id number) ',
'is ',
'begin ',
'  for v_rec in ',
'  ( ',
'    select parent_node_id from pmap_hierarchy ',
'    where node_id = p_node_id ',
'  ) loop ',
'    delete_node(v_rec.parent_node_id, p_node_id); ',
'  end loop; ',
'end delete_watches; ',
'  ',
'-------------------------------------------------------------------- ',
'-- Direct Link ',
'-------------------------------------------------------------------- ',
'  ',
'function direct_link(p_node_id number) ',
'    return varchar2 ',
'is ',
'  v_target varchar2(200); ',
'begin ',
unistr('  return ''<a href="'' || direct_link_url(p_node_id) || ''">\66F4\65B0\30DA\30FC\30B8</a>''; '),
'end direct_link; ',
'  ',
'function direct_link_url(p_node_id number) ',
'    return varchar2 ',
'is ',
'  v_target varchar2(200); ',
'begin ',
'  for v_rec in ',
'  ( ',
'    select node_id, render_page_target, direct_link from pmap_hierarchy_pv  ',
'    start with node_id = p_node_id connect by prior parent_node_id = node_id ',
'  ) loop ',
'    if (v_rec.direct_link = ''Y'') then ',
'      v_target := ''https://apex.oraclecorp.com/pls/apex/f?p='' || V(''APP_ID'') || '':'' ',
'      || v_rec.render_page_target || '':::NO::P'' || v_rec.render_page_target || ''_NODE_ID:'' || v_rec.node_id ',
'      || ''#POS_NODE_ID_'' || p_node_id; ',
'      return v_target; ',
'     end if; ',
'  end loop; ',
'  return null; ',
'end direct_link_url; ',
'  ',
'function direct_link_uri(p_node_id number) ',
'    return varchar2 ',
'is ',
'  v_target varchar2(200); ',
'begin ',
'  for v_rec in ',
'  ( ',
'    select node_id, render_page_target, direct_link from pmap_hierarchy_pv  ',
'    start with node_id = p_node_id connect by prior parent_node_id = node_id ',
'  ) loop ',
'    if (v_rec.direct_link = ''Y'') then ',
'      v_target := ''f?p='' || V(''APP_ID'') || '':'' || v_rec.render_page_target || '':'' || V(''SESSION'') || '':'' || v(''APP_PAGE_ID'') || '':NO::P''  ',
'      || v_rec.render_page_target || ''_NODE_ID:'' || v_rec.node_id || ''#POS_NODE_ID_'' || p_node_id; ',
'      return v_target; ',
'     end if; ',
'  end loop; ',
'  return null; ',
'end direct_link_uri; ',
'  ',
'function direct_link_title(p_node_id number) ',
'    return varchar2 ',
'is ',
'begin ',
'  for v_rec in ',
'  ( ',
'    select node_id, title, direct_link from pmap_hierarchy_pv  ',
'    start with node_id = p_node_id connect by prior parent_node_id = node_id ',
'  ) loop ',
'    if (v_rec.direct_link = ''Y'') then ',
'      return v_rec.title; ',
'    end if; ',
'  end loop; ',
'  return null; ',
'end direct_link_title; ',
'  ',
'-------------------------------------------------------------------- ',
'-- Collapsiblle Region ',
'-------------------------------------------------------------------- ',
'  ',
'procedure collapse_region_start_open( ',
'      p_node_id    number, ',
'      p_title      varchar2) ',
'is ',
'  v_region_id varchar2(30); ',
'  v_style_header   pmap_types.style_header%type; ',
