'procedure set_http_headers( ',
'    p_node_id number) ',
'is ',
'  v_i number := 1; ',
'  type t_headers is table of varchar2(200) index by varchar2(200); ',
'  type t_pris    is table of number index by varchar2(200); ',
'  v_headers t_headers; ',
'  v_pris    t_pris; ',
'  v_name  pmap_http_headers.header_name%type; ',
'  v_value pmap_http_headers.header_value%type; ',
'  v_pri   number; ',
'begin ',
'  -- At first, delete all headers. ',
'  apex_web_service.g_request_headers.delete; ',
'  -- get headers to put. ',
'  for v_rec in ( ',
'    select h.header_name, h.header_value, p.pvlevel ',
'    from  ',
'    (select node_id, type_id, level as pvlevel from pmap_hierarchy_pv  ',
'     start with node_id = p_node_id connect by prior parent_node_id = node_id) p, ',
'     pmap_hierarchy_pv t, ',
'     pmap_http_headers h ',
'    where t.parent_node_id = p.node_id and h.node_id = t.node_id and t.type_id = ''HH'' ',
'  ) loop ',
'    begin ',
'      v_pri := v_pris(v_rec.header_name); ',
'      if (v_pri > v_rec.pvlevel) then ',
'        v_headers(v_rec.header_name) := v_rec.header_value; ',
'        v_pris(v_rec.header_name) := v_pri; ',
'      end if; ',
'    exception ',
'      when no_data_found then ',
'        v_headers(v_rec.header_name) := v_rec.header_value; ',
'        v_pris(v_rec.header_name) := v_rec.pvlevel; ',
'    end; ',
'  end loop; ',
'  -- set all headers. ',
'  v_name := v_headers.FIRST;  -- Get first element of array ',
'  WHILE v_name IS NOT NULL LOOP ',
'    apex_web_service.g_request_headers(v_i).name := v_name; ',
'    apex_web_service.g_request_headers(v_i).value := v_headers(v_name); ',
'    v_i := v_i + 1; ',
'    v_name := v_headers.next(v_name); ',
'  END LOOP; ',
'  v_headers.delete; ',
'  v_pris.delete; ',
'end set_http_headers; ',
'  ',
'procedure get_http_user( ',
'  p_node_id number, ',
'  p_username out varchar2, ',
'  p_password out varchar2) ',
'is ',
'  v_username  pmap_http_users.username%type := null; ',
'  v_password  pmap_http_users.password%type := null; ',
'  v_pri   number := null;  ',
'begin ',
'  for v_rec in ( ',
'    select u.username, u.password, p.pvlevel ',
'    from ',
'    (select node_id, type_id, level as pvlevel from pmap_hierarchy_pv  ',
'     start with node_id = p_node_id connect by prior parent_node_id = node_id) p, ',
'     pmap_hierarchy_pv t, ',
'     pmap_http_users u ',
'    where t.parent_node_id = p.node_id and u.node_id = t.node_id and t.type_id = ''HU'' ',
'  ) loop ',
'    if (v_pri is null or v_pri > v_rec.pvlevel) then ',
'      v_username := v_rec.username; ',
'      v_password := v_rec.password; ',
'      v_pri := v_rec.pvlevel; ',
'    end if; ',
'  end loop; ',
'  p_username := v_username; ',
'  p_password := v_password; ',
'end get_http_user; ',
