'function get_http_url_prefix( ',
'  p_node_id number) ',
'  return varchar2 ',
'is ',
'  v_url_prefix  pmap_http_url_prefixes.url_prefix%type := null; ',
'  v_pri   number := null; ',
'begin ',
'  for v_rec in ( ',
'    select f.url_prefix, p.pvlevel ',
'    from ',
'    (select node_id, type_id, level as pvlevel from pmap_hierarchy_pv  ',
'     start with node_id = p_node_id connect by prior parent_node_id = node_id) p, ',
'     pmap_hierarchy_pv t, ',
'     pmap_http_url_prefixes f ',
'    where t.parent_node_id = p.node_id and f.node_id = t.node_id and t.type_id = ''HP'' ',
'  ) loop ',
'    if (v_pri is null or v_pri > v_rec.pvlevel) then ',
'      v_url_prefix := v_rec.url_prefix; ',
'      v_pri := v_rec.pvlevel; ',
'    end if; ',
'  end loop; ',
'  return v_url_prefix; ',
'end get_http_url_prefix; ',
