'function get_substituted_url( ',
'    p_node_id number) ',
'    return varchar2 ',
'is ',
'  type t_substitutes is table of varchar2(200) index by varchar2(200); ',
'  type t_pris    is table of number index by varchar2(200); ',
'  v_substitutes t_substitutes; ',
'  v_pris    t_pris; ',
'  v_pattern pmap_http_substitutes.pattern_string%type; ',
'  v_replace pmap_http_substitutes.replace_string%type; ',
'  v_pri   number; ',
'  v_url     pmap_rest_requests.url%type; ',
'  v_prefix  pmap_http_url_prefixes.url_prefix%type; ',
'begin ',
'  -- find prefix at first ',
'  v_prefix := get_http_url_prefix(p_node_id); ',
'  -- construct url to replace. ',
'  begin ',
'    select url into v_url from pmap_rest_requests where node_id = p_node_id; ',
'    v_url := v_prefix || v_url;  ',
'  exception ',
'     when no_data_found then ',
'       v_url := v_prefix; ',
'  end; ',
'  -- gather all replacement conditions. ',
'  for v_rec in ( ',
'    select s.pattern_string, s.replace_string, p.pvlevel ',
'    from  ',
'    (select node_id, type_id, level as pvlevel from pmap_hierarchy_pv  ',
'     start with node_id = p_node_id connect by prior parent_node_id = node_id) p, ',
'     pmap_hierarchy_pv t, ',
'     pmap_http_substitutes s ',
'    where t.parent_node_id = p.node_id and s.node_id = t.node_id and t.type_id = ''HS'' ',
'  ) loop ',
'    begin ',
'      v_pri := v_pris(v_rec.pattern_string); ',
'      if (v_pri > v_rec.pvlevel) then ',
'        v_substitutes(v_rec.pattern_string) := v_rec.replace_string; ',
'        v_pris(v_rec.pattern_string) := v_pri; ',
'      end if; ',
'    exception ',
'      when no_data_found then ',
'        v_substitutes(v_rec.pattern_string) := v_rec.replace_string; ',
'        v_pris(v_rec.pattern_string) := v_rec.pvlevel; ',
'    end; ',
'  end loop; ',
'  -- set all headers. ',
'  v_pattern := v_substitutes.FIRST;  -- Get first element of array ',
'  WHILE v_pattern IS NOT NULL LOOP ',
'    v_replace := v_substitutes(v_pattern); ',
'    v_url := regexp_replace(v_url, v_pattern, v_replace); ',
'    v_pattern := v_substitutes.next(v_pattern); ',
'  END LOOP; ',
'  v_substitutes.delete; ',
'  v_pris.delete; ',
'  return v_url; ',
'end get_substituted_url; ',
'  ',
'function get_http_proxy( ',
'  p_node_id number) ',
'  return varchar2 ',
'is ',
'  v_http_proxy  pmap_http_proxies.http_proxy%type := null; ',
