'     pmap_http_proxies f ',
'    where t.parent_node_id = p.node_id and f.node_id = t.node_id and t.type_id = ''HX'' ',
'  ) loop ',
'    if (v_pri is null or v_pri > v_rec.pvlevel) then ',
'      v_http_proxy := v_rec.http_proxy; ',
'      v_pri := v_rec.pvlevel; ',
'    end if; ',
'  end loop; ',
'  return v_http_proxy; ',
'end get_http_proxy; ',
