'function get_icon( ',
'  p_node_id number) ',
'  return varchar2 ',
'is ',
'  v_type_id   pmap_nodes.type_id%type; ',
'  v_type_icon pmap_types.type_icon%type; ',
'  v_icon      pmap_test_status_lov.test_status_icon%type; ',
'begin ',
'  select t.type_icon, t.type_id into v_type_icon, v_type_id ',
'  from pmap_nodes n, pmap_types t ',
'  where n.type_id = t.type_id and node_id = p_node_id; ',
'  if (v_type_id = ''T'') then ',
'    begin ',
'      select m.test_status_icon into v_icon ',
'      from pmap_test_status_lov m, pmap_tests t ',
'      where t.test_status = m.test_status_id and t.node_id = p_node_id; ',
'      return v_icon; ',
'    exception ',
'      when no_data_found then ',
'        null; ',
'    end; ',
'  end if; ',
'  return v_type_icon; ',
'exception ',
'  when no_data_found then ',
'    return ''''; ',
'end get_icon; ',
