'-- Tooltip ',
'------------------------------------------------------------------ ',
'  ',
'function get_tooltip( ',
'    p_node_id number) ',
'    return varchar2 ',
'is ',
'  v_type_id          pmap_nodes.type_id%type; ',
'  v_last_updated_by  pmap_nodes.last_updated_by%type; ',
'  v_last_update_date pmap_nodes.last_update_date%type; ',
'begin ',
'  select type_id into v_type_id from pmap_nodes where node_id = p_node_id; ',
'  case v_type_id ',
'  when ''T'' then ',
'    select last_update_date, last_updated_by into v_last_update_date, v_last_updated_by ',
'    from pmap_tests where node_id = p_node_id; ',
'  when ''P'' then ',
'    select last_update_date, last_updated_by into v_last_update_date, v_last_updated_by ',
'    from pmap_nodes where node_id = p_node_id; ',
'  else ',
'    return null; ',
'  end case; ',
unistr('  return ''\6700\7D42\66F4\65B0\8005:'' || v_last_updated_by || '' - '' || ''\6700\7D42\66F4\65B0\65E5:'' '),
'  || to_char(v_last_update_date at time zone ''09:00'', ''DD-MON-YYYY HH24:MI:SS TZH:TZM''); ',
'exception ',
'  when no_data_found then ',
'    return null; ',
'end get_tooltip; ',
