'------------------------------------------------------------------ ',
'-- print long (> 32k) clob  ',
'------------------------------------------------------------------ ',
'  ',
'procedure print_clob(p_clob clob) ',
'is ',
'  v_length number; ',
'  v_chunk_size NUMBER:=2000; ',
'BEGIN ',
'  if (p_clob is null) then ',
'    return; -- do nothing ',
'  end if; ',
'  v_length := dbms_lob.getlength(p_clob); ',
'  -- dbms_lob.getlength of CLOB returns number of chars. ',
'  -- if japanese data in it, actual bytes are longer than the number returned. ',
'  -- if (v_length < 32767) then ',
'  if (v_length < 30001) then ',
'    htp.prn(p_clob); ',
'    return; ',
'  end if; ',
'  FOR i IN 1 .. ceil(v_length/v_chunk_size)  ',
'  LOOP ',
'    htp.prn(substr(p_clob,((i-1)*v_chunk_size)+1,v_chunk_size)); ',
'  END LOOP; ',
'end print_clob; ',
