||'ER_PROCEDURE", "MOVE_PAGE_TARGET", "MOVE_PROCEDURE", "DELETE_PAGE_TARGET", "DELETE_PROCEDURE", "DIRECT_LINK") AS ',
'  SELECT  ',
'  N.NODE_ID, ',
'  N.TITLE, ',
'  H.PARENT_NODE_ID, ',
'  H.NODE_ORDER, ',
'  T.TYPE_ID, ',
'  T.TYPE_NAME, ',
'  T.TYPE_ICON, ',
'  T.CREATE_PAGE_TARGET, ',
'  T.CREATE_PROCEDURE, ',
'  T.UPDATE_PAGE_TARGET, ',
'  T.UPDATE_PROCEDURE, ',
'  T.RENDER_PAGE_TARGET, ',
'  T.RENDER_PROCEDURE, ',
'  T.MOVE_PAGE_TARGET, ',
'  T.MOVE_PROCEDURE, ',
'  T.DELETE_PAGE_TARGET, ',
