'  T.DIRECT_LINK ',
'FROM PMAP_NODES N LEFT OUTER JOIN PMAP_hierarchy H ON N.NODE_ID = H.NODE_ID, ',
'     PMAP_TYPES T ',
'WHERE N.TYPE_ID = T.TYPE_ID ',
'  AND N.NODE_ID NOT IN ',
'  ( ',
'     SELECT NODE_ID FROM PMAP_NODE_RESTRICTIONS WHERE USER_NAME <> v(''APP_USER'') ',
'     AND NODE_ID NOT IN  ',
'     ( ',
