'     ) ',
'  ) ',
';',
'',
'CREATE OR REPLACE FORCE VIEW "PMAP_HIERARCHY_V" ("NODE_ID", "TITLE", "PARENT_NODE_ID", "NODE_ORDER", "TYPE_ID", "TYPE_NAME", "TYPE_ICON", "CREATE_PAGE_TARGET", "CREATE_PROCEDURE", "UPDATE_PAGE_TARGET", "UPDATE_PROCEDURE", "RENDER_PAGE_TARGET", "RENDE'
||'R_PROCEDURE", "MOVE_PAGE_TARGET", "MOVE_PROCEDURE", "DELETE_PAGE_TARGET", "DELETE_PROCEDURE", "DIRECT_LINK") AS ',
'  SELECT  ',
'  N.NODE_ID, ',
'  N.TITLE, ',
'  H.PARENT_NODE_ID, ',
'  H.NODE_ORDER, ',
'  T.TYPE_ID, ',
'  T.TYPE_NAME, ',
